import React from "react";
import { Nav, Navbar, Button } from 'react-bootstrap';

function Header() {
  return (
    <header className="header">
    <Navbar fixed="top" variant="dark">
      <Navbar.Brand href="#home">NNN</Navbar.Brand>
      <Nav className="ml-auto">
        <Nav.Link className="mr-2" href="#home">What is this?</Nav.Link>
        <Nav.Link className="mr-2" href="#features">NNN Rules</Nav.Link>
        <Button className="join-button" variant="danger">Join The Boys</Button>
      </Nav>
    </Navbar>
  </header>
  );
}

export default Header;
